localStorage.setItem('movieKey', JSON.stringify(movieData));

var movieDetail = JSON.parse(localStorage.getItem('movieKey'));

var box = document.createElement('div');
var image = document.createElement('img');
var i = 0;
function timeFun(url){
    image.src = url;
    box.append(image);
    document.querySelector('#slideshow').append(box);
    
}
setInterval(()=>{
    timeFun(movieDetail[i].image_URL);
    i++;
    if(i == 9){
        i=0;
    }
}, 2000);

function display(movieDetail){
    movieDetail.forEach(el => {
        var div = document.createElement('div');
        var imageDiv = document.createElement('div');
        var url = document.createElement('img');
        url.src = el.image_URL;
        var name = document.createElement('h1');
        name.innerText = `Film : ${el.name}`;
        var date = document.createElement('p');
        date.innerText = `Release Date : ${el.date}`;
        var rating = document.createElement('p');
        rating.innerText = `Rating : ${el.Rating}/10` 
        imageDiv.append(url);
        div.append(imageDiv, name, date, rating);
        document.querySelector("#movies").append(div);
    });

}



document.querySelector('#sort-btn').addEventListener('change', ()=>{
    document.querySelector('#movies').innerHTML = "";
    var btnValue = document.querySelector("#sort-btn").value;
    if(btnValue == 'lh'){
        movieDetail.sort((a, b)=>{
            return a.Rating-b.Rating;
        })
    }
    else if(btnValue == 'hl'){
        movieDetail.sort((a, b)=>{
            return b.Rating-a.Rating;
        })

    }else{
        movieDetail = movieData;
    }
    display(movieDetail);
})
display(movieDetail);
